import React, { useState, useEffect } from "react";
import './App.css';
import axios from 'axios';

function App() {
  const [photoGalleryArray, updatePhotoGalleryArray] = useState([]);
  useEffect(() => {
    axios.get("https://jsonplaceholder.typicode.com/photos?_start=0&_limit=5")
      .then(function (response) {

        updatePhotoGalleryArray(response.data)
      })
      .catch(function (error) {
        console.log(error);
      })

  }, [])

  return (
    <div classNameName="App m-5" >
      <nav className="navbar navbar-expand-lg bg-body-tertiary">
  <div className="container-fluid">
    <a className="navbar-brand" href="#">Navbar</a>
    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span className="navbar-toggler-icon"></span>
    </button>
    <div className="collapse navbar-collapse" id="navbarSupportedContent">
      <ul className="navbar-nav me-auto mb-2 mb-lg-0">
        <li className="nav-item">
          <a className="nav-link active" aria-current="page" href="#">Home</a>
        </li>
        <li className="nav-item">
          <a className="nav-link" href="#">Link</a>
        </li>

        <li className="nav-item">
          <a className="nav-link disabled">Disabled</a>
        </li>
      </ul>
      <form className="d-flex" role="search">
        <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search"/>
        <button className="btn btn-outline-success" type="submit">Search</button>
      </form>
    </div>
  </div>
</nav>
      <div classNameName="container ">
        <h1 classNameName="heading">Photo Gallery</h1>
      <div classNameName="row justify-content-center">
      {
        photoGalleryArray.map((photoGalleryArrayItem, index) => {

          return (
            <div classNameName="img-main col-lg-4 col-md-6 col-sm-12 ">
            <div classNameName="image-container" key={index}>
              <img src={photoGalleryArrayItem.url}
                alt={`image_${photoGalleryArrayItem.id}`}

              />

            </div>
            </div>
          );
        })
      }
      </div>
      </div>

    </div>
  );
}

export default App;
